import React, { Component } from "react";
import DisplaySeat from "./DisplaySeat";
import DisplayTableTicket from "./DisplayTableTicket";
import style from "./MovieSeat.module.css";

export default class MovieSeat extends Component {
  render() {
    console.log(style);
    return (
      <div className={`container-fluid pt-4 ${style["main"]}`}>
        <div className={style["container-content"]}>
          <div className="row">
            <div className="col-7">
              <DisplaySeat />
            </div>
            <div className="col-5">
              <DisplayTableTicket />
            </div>
          </div>
        </div>
      </div>
    );
  }
}
